import React, { useEffect, Component, Fragment, useState } from 'react';
import Datas from '../data/course/item.json'; 
import { Link } from 'react-router-dom';
import { Container, Row, Col } from 'react-bootstrap';
import { Styles } from "./common/styles/programmes";
import Aos from 'aos';
import 'aos/dist/aos.css';


class CourseItemGrid extends Component {
    render() {
        return (
            <Fragment>
                {/* Course Item */}
                {
                    Datas.map((data, i) => (
                        <Col lg="6" md="12" key={i}>
                            <div className="course-item">
                                <Link to="/">
                                    <div className="course-image">
                                        <div className="author-img d-flex">
                                            <div className="img">
                                            <p>{data.authorName}</p>
                                            </div>
                                         
                                        </div>
                                     
                                    </div>
                                </Link>
                         
                            </div>
                        </Col>
                    ))
                }

            </Fragment>
        )
    }
}

export default CourseItemGrid
